Great day at the office here in @snowshoemtn 🇺🇸

@jacksongoldstone continued his strong run of performances and qualified first in Junior Men. @finniles was flying on track & earned his first career pole position in Elite Men! Congrats guys & best of luck to the whole @foxmtb team tomorrow 💪
Photo : @nathhughesphoto

World Champ! 🥇

@jacksongoldstone’s epic 2021 season continues as he became the Junior Downhill World Champ today in Val di Sole, Italy. Take a bow, Jackson! 👏 #foxracing

